    <script>
        gsap.registerPlugin(ScrollTrigger);
        var tl = gsap.timeline();

        tl.from('.content', {
            y: '-30%',
            opacity: 0,
            duration: 2,
            ease: Power4.easeOut

        })

        tl.from('.stagger1', {
            opacity: 0,
            y: -50,
            stagger: .3,
            duration: 2,
            ease: Power4.easeOut
        }, "-=1.5")

        tl.from('.stagger2', {
            opacity: 0,
            y: -50,
            stagger: .2,
            duration: 1,
            ease: Power4.easeOut
        }, "-=1.5")

        tl.from('.stagger3', {
            opacity: 0,
            y: -50,
            stagger: .2,
            duration: 1,
            ease: Power4.easeOut
        }, "-=1.5")


        tl.from('.stagger4', {
            opacity: 0,
            x: -50,
            stagger: .2,
            duration: 1,
            ease: Power4.easeOut
        }, "-=1.5")



        gsap.from('.transition2', {
            scrollTrigger: {
                trigger: '.transition2',
                start: "top bottom"
            },
            y: 100,
            opacity: 0,
            duration: 1.3,
            stagger: .5

        }
        )

        gsap.from('.transition3', {
            scrollTrigger: {
                trigger: '.transition3',
                start: "top bottom",
                toggleActions: "restart restart none none"
            },

            x: -200,
            opacity: 0,
            duration: 1.3,
            stagger: .5

        }
        )

        gsap.from('.transition4', {
